import React from 'react';
import '../css/UserNavbar.css';

function UserNavbar({ toggleSidebar }) {

    console.log('userNavBar')
  return (
    <nav className="navbar sidebar">
      <button onClick={toggleSidebar} className="close-button">✖</button>
      <ul className="navbar-list">
        <li><a href='/user/profile'>계정</a></li>
        <li><a href='/user/resume'>이력서</a></li>
        <li><a href='/user/portfolio'>포트폴리오</a></li>
      </ul>
    </nav>
  );
}

export default UserNavbar;
